  [],\n\t\"revision_timestamp\": \"2016-07-27T23:05:31.344475\",\n\t\"name\": \"2014-report-wetland-state-and-transition-model-project\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Report from the 2014 field season of the
  Wetland State-and-Transition Project.  Many National Wildlife Refuges in the Intermountain
  West and Prairie Pothole regions were established to provide wetland habitat for
  migratory birds.  Water management influences vegetation within a wetland and effective
  management mimics the wet-dry cycle of wetlands.  Periodic drying of wetlands increases
  primary productivity and encourages early seral stage vegetation, which if often
  preferred by waterfowl and is more nutritious than vegetation typical of later seral
  stages.   The Wetland State-and-Transition (STM) Model Project aims to assist managers
  of semi-permanent wetlands by 1) developing a conceptual STM to inform management;
  2) Define community phases within wetland states; 3) design an efficient monitoring
  scheme; and 4) provide an analytical framework to estimate transition probabilities
  among states and phases.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
